import React from 'react'

const Profile = ()=>{
    return(
        <div>
            <div>
                <div style={{
                    display: "flex",
                    justifyContent:"space-around",
                    margin:"18px 0px"
                }}>
                    <img style={{
                        width: "150px", 
                        height:"150px", 
                        borderRadius:"75px"
                    }}
                    src="images/hoodwink.png"/>
                </div>
                <div>
                    <h4>Hoodwink</h4>

                    <div style={{display:"flex", justifyContent:"space-between", width:"106%"}}>
                        <h6>1 posts</h6>
                        <h6>1 followers</h6>
                        <h6>1 following</h6>
                    </div>

                </div>
            </div>
        </div>
    )
}

export default Profile
